import {
  SMALL_LOADER_START,
  SMALL_LOADER_STOP
} from '../actions/smallLoader';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case SMALL_LOADER_START: true
      return{}
    case SMALL_LOADER_STOP: false
    default:
      return statePart;
  }
}
